(window.webpackJsonp=window.webpackJsonp||[]).push([[79],{435:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1048-han-la-troi-nhan-danh-su"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1048-han-la-troi-nhan-danh-su"}},[n._v("#")]),n._v(" Chương 1048: Hắn là trời nhận danh sư!")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("br"),t("br"),n._v("Ầm!"),t("br"),t("br"),n._v("Đại địa chấn chiến, vô số phòng xá sụp đổ, trước mắt xuất hiện một cái cực lớn chưởng ấn, Trương Huyền tràn đầy chật vật, một thân bụi bặm."),t("br"),t("br"),n._v("May mắn hắn phản ứng nhanh, để Ngoan Nhân công kích, nếu không, lần này, hai người đều đem biến thành bánh thịt, bị tại chỗ chụp chết."),t("br"),t("br"),n._v("“Làm sao lại mạnh như vậy?”"),t("br"),t("br"),n._v("Phùng Huân cắn răng, mặt mũi khó tin."),t("br"),t("br"),n._v("Hắn là Chiến sư đường thiên phu trưởng, đối mặt bình thường Thánh vực tứ trọng danh sư, đều có thể nhẹ nhõm giết chết, nhưng trước mắt này vị, nhưng thật giống như không thể rung chuyển núi cao đồng dạng... Có phần mạnh vượt qua dự đoán."),t("br"),t("br"),n._v("Chẳng lẽ trước đó cùng Ngô sư chiến đấu, giữ thực lực?"),t("br"),t("br"),n._v("Không phải ah!"),t("br"),t("br"),n._v("“Không đúng, hắn nhất định là luyện hóa Lôi Nguyên châu, mượn thứ này cùng đại trận lực lượng!” Con ngươi thu hẹp, Phùng Huân trong mắt tràn đầy hoảng sợ."),t("br"),t("br"),n._v("Vốn cho rằng ra tay có thể ngăn cản, hiện tại xem ra, đã chậm!"),t("br"),t("br"),n._v("Đối phương mặc dù không hoàn toàn khống chế Lôi Nguyên châu, nhưng nhìn bộ dáng, chí ít cũng luyện hóa 7%, tám mươi, mượn nhờ thứ này cùng trận pháp, cho dù Thánh vực ngũ trọng cường giả tới, cũng chưa chắc có thể chống lại, huống chi bọn họ."),t("br"),t("br"),n._v("“Ngươi là ai?”"),t("br"),t("br"),n._v("Cùng hắn khiếp sợ đồng dạng, Thạch Diệp Vương cũng đầy là hoảng sợ, bỗng nhiên vừa quay đầu, lạnh lùng nhìn chăm chú về phía Trương Huyền."),t("br"),t("br"),n._v("Vừa rồi sát lục chi khí, kinh khủng đến cực điểm, so với hắn đều không kém chút nào, một cái nhân tộc tiểu tử trên thân đột nhiên toả ra, để hắn khó tin."),t("br"),t("br"),n._v("“Đi!”"),t("br"),t("br"),n._v("Biết Phùng Huân ở đây, nói càng nhiều càng phiền phức, một tiếng hô khẽ, Trương Huyền lôi kéo hắn, tiếp tục hướng chạy ra ngoài."),t("br"),t("br"),n._v("Kẻ trước mắt này, thực lực so Tử Diệp Vương, Kim Diệp Vương đám người mạnh mẽ quá nhiều, nhờ vào hai người bọn họ cho dù muốn ngăn cản, đều không thể thành công, cùng hắn bị giết, còn không bằng mau mau rời khỏi."),t("br"),t("br"),n._v("“Muốn đi? Đi được rồi chứ?”"),t("br"),t("br"),n._v("Hừ lạnh một tiếng, Thạch Diệp Vương năm ngón tay mở ra, bỗng nhiên một trảo."),t("br"),t("br"),n._v("Soạt!"),t("br"),t("br"),n._v("Lơ lửng Lôi Nguyên châu hoàn toàn rơi vào lòng bàn tay của hắn, ngón tay nhẹ nhàng bắn ra, một tiếng nổ vang, mấy đạo lôi điện từ không trung đánh xuống, tạo thành một cái lồng giam, đem hai người bao phủ ở bên trong."),t("br"),t("br"),n._v("“Trốn không thoát...”"),t("br"),t("br"),n._v("Nhìn thấy bốn phía bị phong tỏa, một khi tiến lên, vô cùng có khả năng tại chỗ nổ thành tro tàn, Trương Huyền trong lòng lạnh xuống."),t("br"),t("br"),n._v("Đối phương đã hoàn toàn luyện hóa Lôi Nguyên châu, nắm trong tay lôi đình chi hải đại trận, chỉ cần tại trận pháp phạm vi ra không được, liền không khả năng chạy trốn đối phương đuổi bắt."),t("br"),t("br"),n._v("“Trương sư, ta Chiến sư đường có một cái tuyệt chiêu, có thể để cho thực lực cấp tốc bạo tăng gấp đôi, ta đi qua cản trở hắn, ngươi thừa cơ chạy trốn...”"),t("br"),t("br"),n._v("Vùng vẫy một hồi, đứng dậy, Phùng Huân đứng tại Trương Huyền trước mặt, khoát tay áo."),t("br"),t("br"),n._v("“Bạo tăng gấp đôi? Thi triển xong, ngươi còn có cơ hội chạy trốn ư?”"),t("br"),t("br"),n._v("Nhướng mày, Trương Huyền nhìn qua."),t("br"),t("br"),n._v("Loại này để lực lượng cấp tốc bạo tăng tuyệt chiêu, bình thường đều là hao tổn cơ sở, hao tổn tu vi, một khi sử dụng, cho dù có thể chém giết đối thủ, bản thân cũng tất nhiên sống không lâu lâu."),t("br"),t("br"),n._v("Không trả lời câu hỏi của hắn, Phùng Huân ngược lại nhẹ nhàng cười một tiếng: “Trương viện trưởng, học sinh của ngươi để chúng ta Chiến sư đường bị làm nhục, nói thật... Lần thứ nhất trông thấy, liền không thích ngươi! Luận võ chỉ là cớ, muốn tìm một cơ hội giáo huấn ngươi một trận thôi, chỉ tiếc, vẫn không thành công!”"),t("br"),t("br"),n._v("“Mặc dù đối ngươi không thích, nhưng... Cũng biết, ngươi sống, so ta tác dụng lớn, ngươi đối nhân tộc có càng lớn tác dụng!”"),t("br"),t("br"),n._v("“Không muốn thừa nhận, nhưng cũng không thể không thừa nhận... Suy nghĩ một chút đều cảm thấy có chút bi ai.”"),t("br"),t("br"),n._v("“Bất quá, cũng không có gì, nhân tộc hùng mạnh, so người dung nhập quan trọng hơn. Cho nên... Một lát nữa, ta bổ ra lôi điện bao vây, ngươi thừa cơ chạy trốn, có thể trốn, liền chạy... Nhất định phải sống!”"),t("br"),t("br"),n._v("“Trốn?”"),t("br"),t("br"),n._v("Không nghĩ tới cái tên này, thời khắc mấu chốt, có thể bài trừ ân oán cá nhân, một lòng vì nhân tộc, Trương Huyền trong lòng có chút cảm động, nhẹ gật đầu: “Tốt!”"),t("br"),t("br"),n._v("“Bắt đầu đi!”"),t("br"),t("br"),n._v("Thấy hắn đồng ý, Phùng Huân thở phào nhẹ nhõm, lông mày nâng lên, đột nhiên khí tức trên thân bỗng nhiên rút lên."),t("br"),t("br"),n._v("Ầm ầm!"),t("br"),t("br"),n._v("Ngay tại khí tức tích góp tới cực điểm, tính toán vận chuyển bí pháp thời điểm, đột nhiên cảm thấy cái ót bị cùng nhau lực lượng bỗng nhiên va chạm, mắt tối sầm lại, thân thể nặng nề ngã trên mặt đất, ngất đi."),t("br"),t("br"),n._v("“Cho dù thi triển bí pháp, chúng ta cũng trốn không thoát, thật không tiện...”"),t("br"),t("br"),n._v("Đem cái tên này đập choáng, Trương Huyền bất đắc dĩ lắc đầu."),t("br"),t("br"),n._v("Ý nghĩ của đối phương thật là không tệ, cũng là hiện nay biện pháp tốt nhất, nhưng mà... Đối với hắn mà nói, sẽ chỉ làm tất cả mọi người quân bị tiêu diệt."),t("br"),t("br"),n._v("Cho dù tại hắn ngăn cản bên dưới, mình có thể chạy trốn, có thể căn bản trốn không thoát lôi đình chi hải phạm vi, chỉ cần còn tại bên trong, liền đồng dạng sẽ bị chém giết..."),t("br"),t("br"),n._v("Hơn nữa, cái tên này không giải quyết, Ngô sư đám người liền sẽ bị tìm ra, đồng dạng khó thoát vận rủi."),t("br"),t("br"),n._v("Cho nên, hiện tại phương pháp tốt nhất, không phải chạy trốn, mà là... Cùng hắn đối kháng!"),t("br"),t("br"),n._v("Hai người đều là truyền âm, đối diện Thạch Diệp Vương, cũng không hiểu rõ tình hình, nhưng nhìn thấy bọn họ tự giết lẫn nhau, vẫn là không nhịn được sững sờ."),t("br"),t("br"),n._v("“Thạch Diệp Vương, đã lâu không gặp, vừa rồi ngươi không phải hỏi ta là ai ư? Hiện tại sẽ nói cho ngươi biết, là ta...”"),t("br"),t("br"),n._v("Đem Phùng Huân rút choáng, ngẩng đầu nhìn về phía cách đó không xa Dị Linh tộc vương giả, Trương Huyền cười cười, thân thể “Kẽo kẹt, kẽo kẹt!” Vang vọng, trước ngực ngọc bài, ánh sáng lóe lên, hình như giải trừ một loại nào đó ngụy trang, cả người trở nên đồ sộ, hùng hậu sát lục chi khí lan tràn ra, cho người ta một loại mạnh mẽ như núi cảm giác."),t("br"),t("br"),n._v("“Tử Diệp Vương?”"),t("br"),n._v("Thấy rõ dung mạo của đối phương, Thạch Diệp Vương sững sờ."),t("br"),t("br"),n._v("“Là ta!” Trương Huyền nhẹ gật đầu."),t("br"),t("br"),n._v("Cái khác mấy đại vương giả đều bị chém giết, kẻ trước mắt này, làm không cẩn thận đã biết, nhưng Tử Diệp Vương không có chết, vẫn ở lại bản thân Thiên Nghĩ Phong sào, lúc này ngụy trang hắn, thích hợp nhất."),t("br"),t("br"),n._v("Lại nói, đối cái tên này cũng quen thuộc nhất, ngụy trang, rất khó để cho người ta phát hiện sơ hở."),t("br"),t("br"),n._v("“Ngươi cùng Thủy Diệp vương đi thi hành nhiệm vụ, vẫn không có tin tức truyền đến, đến cùng xảy ra chuyện gì?”"),t("br"),t("br"),n._v("Thạch Diệp Vương sầm mặt lại."),t("br"),t("br"),n._v("Cái tên này cùng Thủy Diệp vương cùng đi Độc điện tìm kiếm bản đồ, kết quả, Thủy Diệp vương linh hồn ngọc bài vỡ vụn, cái tên này mặc dù không có việc gì, nhưng vẫn không có tin tức, tất cả mọi người còn tưởng rằng, đã bị độc thủ, không nghĩ tới đột nhiên xuất hiện."),t("br"),t("br"),n._v("“Ngươi cũng thấy đấy, ta lặng lẽ ngụy trang dung mạo, lẫn vào trong nhân loại, vì lấy được tín nhiệm của bọn hắn, không dám tùy ý đưa tin...”"),t("br"),t("br"),n._v("Trương Huyền nói."),t("br"),t("br"),n._v("“Lẫn vào nhân loại?”"),t("br"),t("br"),n._v("Thạch Diệp Vương cau mày, thần thức lan tràn, trong nháy mắt đem vị này Tử Diệp Vương bao phủ."),t("br"),t("br"),n._v("Nói thật, đối phương đều mất tích hơn nửa tháng, đột nhiên xuất hiện, thực sự khó mà tin được."),t("br"),t("br"),n._v("Dò xét một phen, đối phương trong cơ thể chém giết chân khí tinh thuần, khí tức hùng hậu, không có vấn đề chút nào, nói cách khác, đứng ở trước mặt hắn, quả thực là Tử Diệp Vương."),t("br"),t("br"),n._v("“Ừm, ta biết được nhân loại một bí mật lớn, dính dáng cực lớn, một khi tin tức xác định, vô cùng có khả năng để chúng ta linh tộc người hủy diệt... Cho nên, không kịp bẩm báo, liền ngụy trang lẫn vào nhân loại.”"),t("br"),t("br"),n._v("Biết đối phương lặng lẽ dò xét, Trương Huyền cũng không tránh né, mà là lông mày nhăn lại, thấp giọng."),t("br"),t("br"),n._v("“Hủy diệt?”"),t("br"),t("br"),n._v("Thu hồi thần thức, Thạch Diệp Vương lắc đầu: “Nói đùa cái gì, năm đó Khổng sư cường đại như thế, cũng chỉ là đem chúng ta ngăn tại đại lục bên ngoài, tin tức gì, có thể để cho chúng ta hủy diệt?”"),t("br"),t("br"),n._v("Khổng sư sáng lập danh sư chức nghiệp, nhất thống nhân tộc, cường đại tột đỉnh, khi đó, Dị Linh tộc nhân mặc dù không cách nào chống lại, lại cũng chỉ là rời khỏi đại lục, bảo lưu lại hương hỏa, làm sao có thể một tin tức, để linh tộc hủy diệt!"),t("br"),t("br"),n._v("Bắn tiếng đe doạ!"),t("br"),t("br"),n._v("“Ta vừa mới bắt đầu cũng không tin, nhưng mà... Đây là sự thật!” Trương Huyền khuôn mặt thâm trầm."),t("br"),t("br"),n._v("Hắn ngụy trang Tử Diệp Vương giống như, khẳng định cũng biết hoài nghi, vì để cho đối phương không đi nghĩ chuyện này, biện pháp tốt nhất chính là dời đi lực chú ý... Nói một kiện để hắn khiếp sợ, không có rảnh hoài nghi chuyện."),t("br"),t("br"),n._v("“Sự thật? Chuyện gì?”"),t("br"),t("br"),n._v("Thấy hắn như thế biểu lộ, Thạch Diệp Vương nhìn lại."),t("br"),t("br"),n._v("Nói thật, hắn hiện tại vẫn như cũ không tin trước mắt vị này Tử Diệp Vương, có điều, cũng không gây trở ngại hắn nghe đối phương nói tin tức."),t("br"),t("br"),n._v("“Ngươi có nghe nói qua trời nhận danh sư?” Trương Huyền nhìn qua."),t("br"),t("br"),n._v("“Trời nhận danh sư?”"),t("br"),t("br"),n._v("Sửng sốt một chút, Thạch Diệp Vương con ngươi co rụt lại: “Đương nhiên biết, Khổng sư chính là! Loại này danh sư, có thể có được thiên địa công nhận, là chân chính vô địch tồn tại, chẳng lẽ...”"),t("br"),t("br"),n._v("“Không sai... Lần này vốn là để cho ta thi hành đi Độc điện nhiệm vụ, kết quả, trong lúc vô tình để cho ta phát hiện một vị trời nhận danh sư, lúc này mới không kịp bẩm báo, tạm thời thay đổi kế hoạch, ngụy trang thành nhân loại, lẫn vào đám người!”"),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("“Cái này sao có thể! Căn cứ chúng ta lấy được tin tức, trời nhận danh sư từ trước tới nay chỉ có Khổng sư một người đạt tới, về sau lại không người có thể hoàn thành, cho dù hắn thân truyền, bảy mươi hai hiền đều không được... Tin tức này, ngươi từ nơi nào nghe được?”"),t("br"),t("br"),n._v("Thân thể cứng ngắc, Thạch Diệp Vương khó tin."),t("br"),t("br"),n._v("Trời nhận danh sư dính dáng quá lớn, nếu quả thật có một cái, đạt tới Khổng sư độ cao, chỉ sợ bọn họ Dị Linh tộc nhân, làm không cẩn thận thật sẽ toàn quân bị diệt."),t("br"),t("br"),n._v("Không nói cái khác, năm đó bọn họ trốn đi đại lục, nguyên khí tổn hao nhiều, nghỉ ngơi lấy lại sức hết mấy vạn năm, lúc này mới xem như hoàn toàn khôi phục, lại muốn đến như vậy một vị... Thật sự không có cách nào chống lại."),t("br"),t("br"),n._v("Đi qua mấy vạn năm phát triển, bọn họ lần nữa khôi phục, nhưng nhân tộc nắm giữ danh sư, cũng biến thành càng thêm cường đại."),t("br"),t("br"),n._v("“Tin tức này chắc chắn 100%, hơn nữa... Ta vẫn đi theo vị này trời nhận danh sư sau lưng, cố ý đem hắn dụ dỗ đến nơi này...” Trương Huyền gật đầu."),t("br"),t("br"),n._v("“Dụ dỗ đến đây?”"),t("br"),t("br"),n._v("Sửng sốt một chút, Thạch Diệp Vương cúi đầu nhìn về phía nằm trên mặt đất đã hôn mê Phùng Húc: “Ngươi chẳng lẽ nói hắn... Chính là vị kia trời nhận danh sư?”"),t("br"),t("br"),n._v("“Không sai, đúng là hắn!”"),t("br"),t("br"),n._v("Trương Huyền đáp một tiếng, nghĩa chính ngôn từ, âm vang mạnh mẽ."),t("br"),t("br"),n._v("“Cái này...” Mày nhăn lại, Thạch Diệp Vương tràn đầy hoài nghi."),t("br"),t("br"),n._v("Kẻ trước mắt này, mặc dù nắm giữ vượt cấp năng lực chiến đấu, nhưng thoạt nhìn có chút lỗ mãng, cùng trong truyền thuyết trời nhận danh sư, không chút nào giống."),t("br"),t("br"),n._v("“Thế nào, không tin?”"),t("br"),t("br"),n._v("Trương Huyền ngụy trang Tử Diệp Vương cười nhạo một tiếng: “Chúng ta linh tộc khẳng định cũng có kiểm nghiệm trời nhận danh sư phương pháp đi, nếu như không tin, ngươi hoàn toàn có thể nghiệm chứng một chút!”"),t("br"),t("br"),n._v("“Có là có...” Thạch Diệp Vương cau mày: “Chính là khá là phiền toái...”"),t("br"),t("br"),n._v("“Phiền phức không tính là gì, mấu chốt chính là, một khi xác nhận hắn chính là trời nhận danh sư, chỉ cần có thể nghĩ biện pháp, để hắn cho chúng ta sử dụng, chúng ta linh tộc tất nhiên càng thêm cường đại, chúng ta công lao, khiến cho người ghé mắt, rêu rao sử sách, cũng chỉ là vấn đề thời gian!”"),t("br"),t("br"),n._v("Trương Huyền thanh âm bên trong mang theo mê hoặc hương vị."),t("br"),t("br"),n._v("“Như thế...”"),t("br"),t("br"),n._v("Thạch Diệp Vương nhẹ gật đầu, chần chờ một chút: “Bất quá, muốn đo lường trời nhận danh sư, cần Ngọc Diệp Vương ra tay, chỉ có hắn có năng lực như thế, chỉ cần hắn tới, liền có thể xác nhận vị này đến cùng phải hay không trời nhận danh sư!”"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1056"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1058"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);